<ul>
<li>Okay, so here is the list of topics and some of tooling that we are going to cover in the next 13 weeks</li>
<li>Today we're talking about How the web works</li>
<li>And in future lessons were going to cover
<ul>
<li>HTML5 - which is the building blocks of our web pages - how to mark up documents in a compliant way and use all of the sementic tags properly</li>
<li>CSS3 - what we use to style our pages - to be make them really magical with modern CSS</li>
<li>and JavaScript - what we use to add important user interactions to our pages</li>
<li>We also talk about accessibility (or referred to as &quot;a11y&quot;)</li>
<li>We'll dive into some modern tech stacks and use libraries like TailwindCSS, VueJS and Nuxt</li>
<li>And then we've got a whole list of modern tools that you'll get to use and experiment with. These are the exact same tools you're going to use when you land in industry, so it's really important you get familiar with them now</li>
</ul>
</li>
</ul>
